<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=yes">
    <title>Icon Pack - All Icons & Weights</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        :root {
            --bg-primary: #f9fafb;
            --bg-secondary: white;
            --bg-tertiary: #f3f4f6;
            --text-primary: #111827;
            --text-secondary: #6b7280;
            --text-tertiary: #4b5563;
            --border-color: #e5e7eb;
            --border-hover: #d1d5db;
            --accent-color: #4f46e5;
            --accent-light: #eef2ff;
            --card-bg: white;
            --shadow: rgba(0, 0, 0, 0.1);
            --header-bg: rgba(255, 255, 255, 0.9);
            --scrollbar-track: #f1f1f1;
            --scrollbar-thumb: #4f46e5;
        }

        [data-theme="dark"] {
            --bg-primary: #111827;
            --bg-secondary: #1f2937;
            --bg-tertiary: #374151;
            --text-primary: #f9fafb;
            --text-secondary: #9ca3af;
            --text-tertiary: #d1d5db;
            --border-color: #374151;
            --border-hover: #4b5563;
            --accent-color: #818cf8;
            --accent-light: #2d2f3a;
            --card-bg: #1f2937;
            --shadow: rgba(0, 0, 0, 0.3);
            --header-bg: rgba(31, 41, 55, 0.9);
            --scrollbar-track: #374151;
            --scrollbar-thumb: #818cf8;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
            background: var(--bg-primary);
            color: var(--text-primary);
            line-height: 1.5;
            overflow-x: hidden;
            width: 100%;
            transition: background-color 0.3s, color 0.3s;
        }

        .header {
            background: var(--header-bg);
            border-bottom: 1px solid var(--border-color);
            padding: 1rem 2rem;
            position: sticky;
            top: 0;
            z-index: 40;
            backdrop-filter: blur(8px);
            width: 100%;
            transition: background-color 0.3s, border-color 0.3s;
        }

        .header-top {
            display: flex;
            justify-content: space-between;
            align-items: center;
            gap: 1rem;
            flex-wrap: wrap;
        }

        .header-left {
            display: flex;
            align-items: center;
            gap: 1rem;
            flex-wrap: wrap;
        }

        .header h1 {
            font-size: 1.75rem;
            font-weight: 600;
            background: linear-gradient(135deg, var(--accent-color), #7c3aed);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            white-space: nowrap;
        }

        .theme-toggle, .color-picker-toggle {
            background: var(--bg-tertiary);
            border: 1px solid var(--border-color);
            border-radius: 30px;
            padding: 0.35rem 0.75rem;
            font-size: 0.875rem;
            cursor: pointer;
            display: flex;
            align-items: center;
            gap: 0.35rem;
            color: var(--text-secondary);
            transition: all 0.2s;
        }

        .theme-toggle:hover, .color-picker-toggle:hover {
            background: var(--border-hover);
            color: var(--text-primary);
        }

        .color-picker-container {
            position: relative;
        }

        .color-picker-dropdown {
            position: absolute;
            top: 100%;
            right: 0;
            margin-top: 0.5rem;
            background: var(--bg-secondary);
            border: 1px solid var(--border-color);
            border-radius: 12px;
            padding: 1rem;
            box-shadow: 0 10px 25px -5px var(--shadow);
            z-index: 50;
            display: none;
            width: 240px;
        }

        .color-picker-dropdown.active {
            display: block;
        }

        .color-picker-header {
            font-size: 0.875rem;
            font-weight: 600;
            margin-bottom: 0.75rem;
            color: var(--text-primary);
        }

        .color-input {
            width: 100%;
            height: 40px;
            border: 1px solid var(--border-color);
            border-radius: 8px;
            margin-bottom: 0.75rem;
            cursor: pointer;
            background: var(--bg-primary);
        }

        .color-presets {
            display: grid;
            grid-template-columns: repeat(6, 1fr);
            gap: 0.5rem;
            margin-bottom: 0.75rem;
        }

        .color-preset {
            width: 30px;
            height: 30px;
            border-radius: 8px;
            cursor: pointer;
            border: 2px solid transparent;
            transition: all 0.2s;
        }

        .color-preset:hover {
            transform: scale(1.1);
            border-color: var(--accent-color);
        }

        .color-preset.active {
            border-color: var(--text-primary);
        }

        .color-preset.purple { background: #4f46e5; }
        .color-preset.blue { background: #3b82f6; }
        .color-preset.green { background: #10b981; }
        .color-preset.red { background: #ef4444; }
        .color-preset.orange { background: #f97316; }
        .color-preset.pink { background: #ec4899; }

        .header-stats {
            display: flex;
            gap: 1rem;
            color: var(--text-secondary);
            font-size: 0.875rem;
            margin-left: auto;
        }

        .header-stats .stat-item {
            display: flex;
            align-items: center;
            gap: 0.25rem;
            background: var(--bg-tertiary);
            padding: 0.35rem 0.75rem;
            border-radius: 30px;
            white-space: nowrap;
        }

        .header-stats .stat-icon {
            font-size: 1rem;
        }

        .header-buttons {
            display: flex;
            gap: 0.5rem;
            flex-shrink: 0;
        }

        .npm-button, .github-button {
            display: inline-flex;
            align-items: center;
            justify-content: center;
            width: 36px;
            height: 36px;
            border-radius: 50%;
            text-decoration: none;
            transition: all 0.2s;
            box-shadow: 0 2px 4px var(--shadow);
            flex-shrink: 0;
        }

        .npm-button {
            background: #cb3837;
        }

        .github-button {
            background: #24292e;
        }

        [data-theme="dark"] .github-button {
            background: #2b3137;
        }

        .npm-button:hover, .github-button:hover {
            transform: translateY(-2px);
            box-shadow: 0 4px 8px var(--shadow);
        }

        .npm-button:hover {
            background: #b52b2a;
        }

        .github-button:hover {
            background: #1b1f23;
        }

        [data-theme="dark"] .github-button:hover {
            background: #20262b;
        }

        .npm-button img, .github-button img {
            width: 20px;
            height: 20px;
            filter: brightness(0) invert(1);
        }

        .npm-button span, .github-button span {
            display: none;
        }

        .search-container {
            max-width: 500px;
            margin: 0.75rem auto 0.5rem;
            position: relative;
            width: 100%;
        }

        .search-box {
            width: 100%;
            padding: 0.75rem 1rem 0.75rem 2.75rem;
            border: 2px solid var(--border-color);
            border-radius: 40px;
            font-size: 0.95rem;
            transition: all 0.2s;
            background: var(--bg-secondary);
            color: var(--text-primary);
            box-shadow: 0 2px 4px var(--shadow);
        }

        .search-box:focus {
            outline: none;
            border-color: var(--accent-color);
            box-shadow: 0 4px 12px rgba(79, 70, 229, 0.15);
        }

        .search-box::placeholder {
            color: var(--text-secondary);
        }

        .search-icon {
            position: absolute;
            left: 1rem;
            top: 50%;
            transform: translateY(-50%);
            color: var(--text-secondary);
            font-size: 1.1rem;
            pointer-events: none;
        }

        .search-clear {
            position: absolute;
            right: 1rem;
            top: 50%;
            transform: translateY(-50%);
            background: none;
            border: none;
            color: var(--text-secondary);
            font-size: 1.1rem;
            cursor: pointer;
            padding: 0.25rem;
            display: none;
            border-radius: 50%;
            width: 24px;
            height: 24px;
            align-items: center;
            justify-content: center;
        }

        .search-clear:hover {
            background: var(--bg-tertiary);
            color: var(--text-primary);
        }

        .search-box:not(:placeholder-shown) + .search-clear {
            display: flex;
        }

        .weight-tabs {
            display: flex;
            gap: 0.4rem;
            margin: 0.5rem 0 0.25rem;
            flex-wrap: wrap;
            justify-content: center;
            width: 100%;
        }

        .weight-tab {
            padding: 0.4rem 1rem;
            border-radius: 30px;
            font-size: 0.85rem;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s;
            background: var(--bg-secondary);
            border: 1px solid var(--border-color);
            color: var(--text-secondary);
            white-space: nowrap;
        }

        .weight-tab:hover {
            background: var(--bg-tertiary);
            border-color: var(--border-hover);
            color: var(--text-primary);
        }

        .weight-tab.active {
            background: var(--accent-color);
            border-color: var(--accent-color);
            color: white;
        }

        .categories-sidebar {
            position: fixed;
            left: 0;
            top: 135px;
            bottom: 0;
            width: 260px;
            background: var(--bg-secondary);
            border-right: 1px solid var(--border-color);
            padding: 1.5rem 1rem;
            overflow-y: auto;
            transition: transform 0.3s ease, background-color 0.3s, border-color 0.3s;
        }

        .categories-sidebar h3 {
            font-size: 0.8rem;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.05em;
            color: var(--text-secondary);
            margin-bottom: 1rem;
            padding-left: 0.5rem;
        }

        .category-list {
            list-style: none;
        }

        .category-item {
            margin-bottom: 0.2rem;
        }

        .category-link {
            display: block;
            padding: 0.5rem 0.75rem;
            border-radius: 8px;
            color: var(--text-tertiary);
            text-decoration: none;
            font-size: 0.9rem;
            transition: all 0.2s;
            cursor: pointer;
            border-left: 3px solid transparent;
        }

        .category-link:hover {
            background: var(--bg-tertiary);
            border-left-color: var(--border-hover);
            color: var(--text-primary);
        }

        .category-link.active {
            background: var(--accent-light);
            color: var(--accent-color);
            font-weight: 500;
            border-left-color: var(--accent-color);
        }

        .category-count {
            float: right;
            color: var(--text-secondary);
            font-size: 0.8rem;
        }

        .category-link.active .category-count {
            color: var(--accent-color);
        }

        .main-content {
            margin-left: 260px;
            padding: 1.5rem 2rem;
            width: calc(100% - 260px);
        }

        .icons-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(180px, 1fr));
            gap: 1rem;
            margin-top: 1.5rem;
            width: 100%;
        }

        .icon-card {
            background: var(--card-bg);
            border: 1px solid var(--border-color);
            border-radius: 12px;
            padding: 1rem 0.75rem;
            transition: all 0.2s;
            position: relative;
            overflow: hidden;
            cursor: pointer;
            width: 100%;
        }

        .icon-card:hover {
            transform: translateY(-2px);
            box-shadow: 0 10px 25px -5px var(--shadow);
            border-color: var(--accent-color);
        }

        .icon-preview {
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 70px;
            padding: 0.5rem;
            background: var(--bg-primary);
            border-radius: 8px;
            margin-bottom: 0.5rem;
            transition: background-color 0.3s;
        }

        .icon-preview img {
            width: 28px;
            height: 28px;
            transition: transform 0.2s;
            display: block;
            object-fit: contain;
            filter: drop-shadow(0 2px 4px var(--shadow));
        }

        .icon-card:hover .icon-preview img {
            transform: scale(1.1);
        }

        .icon-info {
            text-align: center;
        }

        .icon-name {
            font-weight: 600;
            font-size: 0.8rem;
            color: var(--text-primary);
            margin-bottom: 0.2rem;
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
        }

        .icon-category {
            font-size: 0.7rem;
            color: var(--text-secondary);
            margin-bottom: 0.4rem;
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
            background: var(--bg-tertiary);
            display: inline-block;
            padding: 0.1rem 0.4rem;
            border-radius: 12px;
        }

        .icon-weights {
            display: flex;
            flex-wrap: wrap;
            gap: 0.2rem;
            justify-content: center;
            margin-top: 0.4rem;
        }

        .weight-badge {
            display: inline-flex;
            align-items: center;
            padding: 0.15rem 0.4rem;
            background: var(--bg-tertiary);
            border-radius: 4px;
            font-size: 0.55rem;
            font-weight: 500;
            color: var(--text-secondary);
            transition: all 0.2s;
            text-transform: capitalize;
        }

        .category-section {
            margin-bottom: 2.5rem;
            scroll-margin-top: 135px;
            width: 100%;
        }

        .category-title {
            font-size: 1.25rem;
            font-weight: 600;
            margin-bottom: 1rem;
            padding-bottom: 0.4rem;
            border-bottom: 2px solid var(--border-color);
            display: flex;
            align-items: center;
            gap: 0.75rem;
            position: sticky;
            top: 135px;
            background: var(--bg-primary);
            z-index: 30;
            padding-top: 0.5rem;
            width: 100%;
            transition: background-color 0.3s, border-color 0.3s;
        }

        .category-title span {
            background: var(--bg-tertiary);
            padding: 0.2rem 0.6rem;
            border-radius: 20px;
            font-size: 0.8rem;
            color: var(--text-secondary);
        }

        .loading {
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 400px;
            font-size: 1rem;
            color: var(--text-secondary);
        }

        .no-results {
            text-align: center;
            padding: 3rem;
            color: var(--text-secondary);
            grid-column: 1 / -1;
            background: var(--bg-secondary);
            border-radius: 12px;
            border: 2px dashed var(--border-color);
            width: 100%;
        }

        .no-results p {
            margin-top: 0.75rem;
            font-size: 1rem;
        }

        .copy-tooltip {
            position: absolute;
            top: 0.35rem;
            right: 0.35rem;
            padding: 0.2rem 0.4rem;
            background: var(--text-primary);
            color: var(--bg-primary);
            border-radius: 4px;
            font-size: 0.65rem;
            opacity: 0;
            transition: opacity 0.2s;
            pointer-events: none;
        }

        .icon-card:hover .copy-tooltip {
            opacity: 1;
        }

        .modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(0, 0, 0, 0.5);
            z-index: 1000;
            justify-content: center;
            align-items: center;
            backdrop-filter: blur(4px);
        }

        .modal.active {
            display: flex;
        }

        .modal-content {
            background: var(--bg-secondary);
            border-radius: 16px;
            padding: 1.5rem;
            max-width: 550px;
            width: 90%;
            max-height: 80vh;
            overflow-y: auto;
            box-shadow: 0 25px 50px -12px var(--shadow);
        }

        .modal-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 1rem;
            padding-bottom: 0.75rem;
            border-bottom: 1px solid var(--border-color);
        }

        .modal-header h2 {
            font-size: 1.25rem;
            font-weight: 600;
            color: var(--text-primary);
        }

        .modal-close {
            background: none;
            border: none;
            font-size: 1.5rem;
            cursor: pointer;
            color: var(--text-secondary);
            width: 30px;
            height: 30px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 50%;
            transition: all 0.2s;
        }

        .modal-close:hover {
            background: var(--bg-tertiary);
            color: var(--text-primary);
        }

        .weight-showcase {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(100px, 1fr));
            gap: 0.75rem;
            margin-top: 0.75rem;
        }

        .weight-item {
            text-align: center;
            padding: 0.75rem 0.5rem;
            background: var(--bg-tertiary);
            border-radius: 10px;
            transition: all 0.2s;
            border: 1px solid var(--border-color);
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        .weight-item:hover {
            transform: translateY(-2px);
            box-shadow: 0 4px 6px -1px var(--shadow);
            border-color: var(--accent-color);
        }

        .weight-item img {
            width: 32px;
            height: 32px;
            margin-bottom: 0.4rem;
            object-fit: contain;
            filter: drop-shadow(0 2px 4px var(--shadow));
        }

        .weight-name {
            font-size: 0.75rem;
            font-weight: 500;
            color: var(--text-secondary);
            text-transform: capitalize;
        }

        .import-code {
            margin-top: 1.5rem;
            padding: 1rem;
            background: var(--bg-tertiary);
            border-radius: 10px;
            border: 1px solid var(--border-color);
        }

        .import-code h3 {
            font-size: 0.9rem;
            font-weight: 600;
            margin-bottom: 0.4rem;
            color: var(--text-primary);
        }

        .import-code code {
            display: block;
            padding: 0.75rem;
            background: var(--bg-primary);
            color: var(--text-primary);
            border-radius: 8px;
            font-family: 'SF Mono', Monaco, 'Cascadia Code', 'Roboto Mono', monospace;
            font-size: 0.8rem;
            overflow-x: auto;
            border: 1px solid var(--border-color);
        }

        /* Sidebar overlay for mobile */
        .sidebar-overlay {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(0, 0, 0, 0.5);
            z-index: 90;
            backdrop-filter: blur(2px);
        }

        .sidebar-overlay.active {
            display: block;
        }

        /* Mobile styles */
        @media (max-width: 1024px) {
            body {
                overflow-x: hidden;
                width: 100%;
            }
            
            .header {
                padding: 0.75rem 1rem;
                width: 100%;
            }
            
            .header-left {
                gap: 0.5rem;
            }
            
            .header-stats {
                display: none;
            }
            
            .header h1 {
                font-size: 1.25rem;
            }
            
            .theme-toggle, .color-picker-toggle {
                padding: 0.25rem 0.5rem;
                font-size: 0.75rem;
            }
            
            .npm-button, .github-button {
                width: 36px;
                height: 36px;
                display: flex;
                align-items: center;
                justify-content: center;
            }
            
            .npm-button span, .github-button span {
                display: none;
            }
            
            .search-container {
                max-width: 100%;
                margin: 0.5rem auto;
            }
            
            .weight-tabs {
                flex-wrap: nowrap;
                overflow-x: auto;
                padding-bottom: 0.5rem;
                margin-bottom: 0;
                -webkit-overflow-scrolling: touch;
                scrollbar-width: thin;
                justify-content: flex-start;
            }
            
            .weight-tabs::-webkit-scrollbar {
                height: 3px;
            }
            
            .weight-tabs::-webkit-scrollbar-track {
                background: var(--scrollbar-track);
                border-radius: 10px;
            }
            
            .weight-tabs::-webkit-scrollbar-thumb {
                background: var(--scrollbar-thumb);
                border-radius: 10px;
            }
            
            .weight-tab {
                flex: 0 0 auto;
            }
            
            .categories-sidebar {
                transform: translateX(-100%);
                z-index: 100;
                top: 0;
                padding-top: 1rem;
                box-shadow: none;
                width: 280px;
                height: 100vh;
                position: fixed;
            }
            
            .categories-sidebar.open {
                transform: translateX(0);
                box-shadow: 2px 0 20px var(--shadow);
            }
            
            .main-content {
                margin-left: 0;
                padding: 1rem;
                width: 100%;
            }
            
            .icons-grid {
                grid-template-columns: repeat(auto-fill, minmax(140px, 1fr));
                gap: 0.75rem;
                width: 100%;
            }
            
            .category-title {
                top: 110px;
                font-size: 1.1rem;
                width: 100%;
            }
            
            .sidebar-toggle {
                display: block !important;
                position: fixed;
                bottom: 20px;
                left: 20px;
                z-index: 50;
            }

            .color-picker-dropdown {
                right: auto;
                left: 0;
            }
        }

        @media (max-width: 480px) {
            .icons-grid {
                grid-template-columns: repeat(2, 1fr);
            }
            
            .icon-card {
                padding: 0.75rem 0.5rem;
            }
            
            .icon-preview {
                min-height: 60px;
            }
            
            .icon-preview img {
                width: 24px;
                height: 24px;
            }
            
            .color-picker-dropdown {
                width: 200px;
            }
        }
    </style>
</head>
<body>
    <!-- Sidebar overlay for mobile -->
    <div class="sidebar-overlay" id="sidebarOverlay" onclick="closeSidebar()"></div>

    <div class="header">
        <div class="header-top">
            <div class="header-left">
                <h1>üé® Icon Pack</h1>
                <button class="theme-toggle" id="themeToggle" onclick="toggleTheme()">
                    <span id="themeIcon">üåô</span>
                    <span id="themeText">Dark</span>
                </button>
                <div class="color-picker-container">
                    <button class="color-picker-toggle" id="colorPickerToggle" onclick="toggleColorPicker()">
                        <span>üé®</span>
                        <span>Color</span>
                    </button>
                    <div class="color-picker-dropdown" id="colorPickerDropdown">
                        <div class="color-picker-header">Icon Color</div>
                        <input type="color" class="color-input" id="iconColorInput" value="#4f46e5" onchange="setIconColor(this.value)">
                        <div class="color-presets">
                            <div class="color-preset purple" onclick="setIconColor('#4f46e5')"></div>
                            <div class="color-preset blue" onclick="setIconColor('#3b82f6')"></div>
                            <div class="color-preset green" onclick="setIconColor('#10b981')"></div>
                            <div class="color-preset red" onclick="setIconColor('#ef4444')"></div>

        const WEIGHTS = ["Broken","Duotone","Fill","Outline"];
        const CATEGORIES = ["Arrows","Arrows Action","Astronomy","Building, Infrastructure","Business, Statistic","Call","Design, Tools","Electronic, Devices","Essentional, UI","Faces, Emotions, Stickers","Files","Folders","Food, Kitchen","Hands","Home, Furniture","Like","List","Map & Location","Medicine","Messages, Conversation","Money","Nature, Travel","Network, IT, Programming","Notes","Notifications","School","Search","Security","Settings, Fine Tuning","Shopping, Ecommerce","Sports","Text Formatting","Time","Transport, Parts, Service","Users","Video, Audio, Sound","Weather"];
        const WEIGHT_PRIORITY = ["outline","fill","duotone","broken"];

        // State management
        let state = {
            icons: ICON_DATA,
            filteredIcons: [],
            categories: CATEGORIES,
            weights: WEIGHTS,
            selectedWeight: WEIGHT_PRIORITY[0] || WEIGHTS[0] || 'outline',
            searchQuery: '',
            activeCategory: 'all',
            iconColor: '#4f46e5',
            theme: 'light'
        };

        // Load saved preferences
        function loadPreferences() {
            const savedTheme = localStorage.getItem('iconPack-theme');
            const savedColor = localStorage.getItem('iconPack-color');
            
            if (savedTheme) {
                state.theme = savedTheme;
                document.documentElement.setAttribute('data-theme', savedTheme);
                updateThemeButton();
            }
            
            if (savedColor) {
                state.iconColor = savedColor;
                document.getElementById('iconColorInput').value = savedColor;
            }
        }

        // Toggle theme
        function toggleTheme() {
            state.theme = state.theme === 'light' ? 'dark' : 'light';
            document.documentElement.setAttribute('data-theme', state.theme);
            localStorage.setItem('iconPack-theme', state.theme);
            updateThemeButton();
        }

        // Update theme button
        function updateThemeButton() {
            const icon = document.getElementById('themeIcon');
            const text = document.getElementById('themeText');
            if (state.theme === 'dark') {
                icon.textContent = '‚òÄÔ∏è';
                text.textContent = 'Light';
            } else {
                icon.textContent = 'üåô';
                text.textContent = 'Dark';
            }
        }

        // Toggle color picker
        function toggleColorPicker() {
            document.getElementById('colorPickerDropdown').classList.toggle('active');
        }

        // Set icon color
        function setIconColor(color) {
            state.iconColor = color;
            localStorage.setItem('iconPack-color', color);
            document.getElementById('iconColorInput').value = color;
            
            // Update all icon images with a cache-busting parameter
            document.querySelectorAll('.icon-preview img').forEach(img => {
                const src = img.src.split('?')[0];
                img.src = src + '?color=' + color.substring(1) + '&t=' + Date.now();
            });
            
            // Close color picker on mobile after selection
            if (window.innerWidth <= 1024) {
                document.getElementById('colorPickerDropdown').classList.remove('active');
            }
        }

        // Reset icon color
        function resetIconColor() {
            setIconColor('#4f46e5');
        }

        // Close color picker when clicking outside
        document.addEventListener('click', function(event) {
            const container = document.querySelector('.color-picker-container');
            const dropdown = document.getElementById('colorPickerDropdown');
            if (container && !container.contains(event.target) && dropdown.classList.contains('active')) {
                dropdown.classList.remove('active');
            }
        });

        // Update statistics in header
        function updateStats() {
            const statsEl = document.getElementById('headerStats');
            statsEl.innerHTML = `
                <div class="stat-item"><span class="stat-icon">üì¶</span> ${state.icons.length}</div>
                <div class="stat-item"><span class="stat-icon">‚öñÔ∏è</span> ${state.weights.length}</div>
                <div class="stat-item"><span class="stat-icon">üìÅ</span> ${state.categories.length}</div>
            `;
        }

        // Render weight tabs
        function renderWeightTabs() {
            const container = document.getElementById('weightTabs');
            container.innerHTML = state.weights.map(weight => `
                <button class="weight-tab ${state.selectedWeight === weight ? 'active' : ''}" 
                        onclick="setSelectedWeight('${weight}')">
                    ${weight}
                </button>
            `).join('');
        }

        // Set selected weight
        function setSelectedWeight(weight) {
            state.selectedWeight = weight;
            renderWeightTabs();
            filterIcons();
        }

        // Clear search
        function clearSearch() {
            document.getElementById('search').value = '';
            filterIcons();
        }

        // Render category sidebar
        function renderSidebar() {
            const list = document.getElementById('categoryList');
            list.innerHTML = `
                <li class="category-item">
                    <a class="category-link ${state.activeCategory === 'all' ? 'active' : ''}" 
                       onclick="setCategory('all')">
                        All Icons
                        <span class="category-count">${state.icons.length}</span>
                    </a>
                </li>
                ${state.categories.map(category => {
                    const count = state.icons.filter(icon => icon.categories.includes(category)).length;
                    return `
                        <li class="category-item">
                            <a class="category-link ${state.activeCategory === category ? 'active' : ''}" 
                               onclick="setCategory('${category}')">
                                ${category}
                                <span class="category-count">${count}</span>
                            </a>
                        </li>
                    `;
                }).join('')}
            `;
        }

        // Set active category and scroll to top
        function setCategory(category) {
            state.activeCategory = category;
            renderSidebar();
            
            // Close sidebar on mobile after selection
            if (window.innerWidth <= 1024) {
                closeSidebar();
            }
            
            filterIcons();
            
            // Scroll to top of main content
            document.querySelector('.main-content').scrollTop = 0;
            window.scrollTo({
                top: 0,
                behavior: 'smooth'
            });
        }

        // Close sidebar
        function closeSidebar() {
            document.getElementById('sidebar').classList.remove('open');
            document.getElementById('sidebarOverlay').classList.remove('active');
        }

        // Open sidebar
        function openSidebar() {
            document.getElementById('sidebar').classList.add('open');
            document.getElementById('sidebarOverlay').classList.add('active');
        }

        // Filter icons based on search and category
        function filterIcons() {
            const search = document.getElementById('search').value.toLowerCase().trim();
            state.searchQuery = search;
            
            state.filteredIcons = state.icons.filter(icon => {
                // Search filter
                const matchesSearch = search === '' || 
                    icon.name.toLowerCase().includes(search) ||
                    icon.displayName.toLowerCase().includes(search) ||
                    icon.categories.some(c => c.toLowerCase().includes(search)) ||
                    icon.weights.some(w => w.toLowerCase().includes(search));
                
                // Category filter
                const matchesCategory = state.activeCategory === 'all' || 
                                      icon.categories.includes(state.activeCategory);
                
                return matchesSearch && matchesCategory;
            });
            
            renderIcons();
        }

        // Debounced search
        let searchTimeout;
        document.getElementById('search').addEventListener('input', () => {
            clearTimeout(searchTimeout);
            searchTimeout = setTimeout(filterIcons, 200);
        });

        // Get preview path for icon based on selected weight
        function getPreviewPath(icon) {
            // Try to find the selected weight
            const weightMatch = icon.weightPaths.find(wp => wp.weight === state.selectedWeight);
            if (weightMatch) return weightMatch.path;
            
            // Fallback to priority order
            for (const priority of WEIGHT_PRIORITY) {
                const match = icon.weightPaths.find(wp => wp.weight.toLowerCase() === priority);
                if (match) return match.path;
            }
            
            // Fallback to first available
            return icon.weightPaths[0]?.path || icon.preview;
        }

        // Render icons grouped by category
        function renderIcons() {
            const container = document.getElementById('mainContent');
            
            if (state.filteredIcons.length === 0) {
                container.innerHTML = `
                    <div class="no-results">
                        <span style="font-size: 2.5rem;">üîç</span>
                        <p>No icons found matching your criteria</p>
                        <p style="font-size: 0.8rem; color: var(--text-secondary); margin-top: 0.5rem;">Try adjusting your search</p>
                    </div>
                `;
                return;
            }

            // Group by category
            const grouped = {};
            state.filteredIcons.forEach(icon => {
                const primaryCategory = icon.categories[0] || 'Other';
                if (!grouped[primaryCategory]) {
                    grouped[primaryCategory] = [];
                }
                grouped[primaryCategory].push(icon);
            });

            let html = '';
            for (const [category, icons] of Object.entries(grouped)) {
                html += `
                    <section class="category-section" id="category-${category}">
                        <div class="category-title">
                            ${category}
                            <span>${icons.length} icon${icons.length > 1 ? 's' : ''}</span>
                        </div>
                        <div class="icons-grid">
                `;
                
                icons.forEach(icon => {
                    const previewPath = getPreviewPath(icon);
                    const colorParam = state.iconColor ? '?color=' + state.iconColor.substring(1) : '';
                    html += createIconCard(icon, previewPath + colorParam);
                });
                
                html += `
                        </div>
                    </section>
                `;
            }
            
            container.innerHTML = html;
        }

        // Create icon card HTML
        function createIconCard(icon, previewPath) {
            return `
                <div class="icon-card" onclick="showIconDetails('${icon.name}')">
                    <div class="copy-tooltip">Click for details</div>
                    <div class="icon-preview">
                        <img src="${previewPath}" alt="${icon.displayName}" loading="lazy">
                    </div>
                    <div class="icon-info">
                        <div class="icon-name" title="${icon.name}">${icon.displayName}</div>
                        <div class="icon-category" title="${icon.categories.join(', ')}">
                            ${icon.categories[0]}
                        </div>
                        <div class="icon-weights">
                            ${icon.weights.map(weight => `
                                <span class="weight-badge">${weight}</span>
                            `).join('')}
                        </div>
                    </div>
                </div>
            `;
        }

        // Show modal with all weights for an icon
        function showIconDetails(iconName) {
            const icon = state.icons.find(i => i.name === iconName);
            if (!icon) return;
            
            const modal = document.getElementById('weightModal');
            const title = document.getElementById('modalTitle');
            const content = document.getElementById('modalContent');
            
            title.textContent = icon.displayName;
            
            // Generate previews for each weight
            let weightHtml = '<div class="weight-showcase">';
            
            if (icon.weightPaths && icon.weightPaths.length > 0) {
                icon.weightPaths.forEach(weightPath => {
                    const colorParam = state.iconColor ? '?color=' + state.iconColor.substring(1) : '';
                    weightHtml += `
                        <div class="weight-item">
                            <img src="${weightPath.path}${colorParam}" alt="${weightPath.weight}" 
                                 onerror="this.onerror=null; this.src='data:image/svg+xml;base64,PHN2ZyB3aWR0aD0iMjQiIGhlaWdodD0iMjQiIHZpZXdCb3g9IjAgMCAyNCAyNCIgZmlsbD0ibm9uZSIgeG1sbnM9Imh0dHA6Ly93d3cudzMub3JnLzIwMDAvc3ZnIj48cmVjdCB3aWR0aD0iMjQiIGhlaWdodD0iMjQiIHJ4PSI0IiBmaWxsPSIjRjNGNEY2Ii8+PHRleHQgeD0iMTIiIHk9IjE2IiBmb250LXNpemU9IjEwIiB0ZXh0LWFuY2hvcj0ibWlkZGxlIiBmaWxsPSIjNEY0NkU1IiBmb250LWZhbWlseT0ic3lzdGVtLXVpLCAtYXBwbGUtc3lzdGVtLCBzYW5zLXNlcmlmIiBmb250LXdlaWdodD0iNTAwIj4ke3dlaWdodFBhdGgud2VpZ2h0LnN1YnN0cmluZygwLDIpfTwvdGV4dD48L3N2Zz4='">
                            <div class="weight-name">${weightPath.weight}</div>
                        </div>
                    `;
                });
            } else {
                // Fallback if no weight paths found
                icon.weights.forEach(weight => {
                    weightHtml += `
                        <div class="weight-item">
                            <div style="width:32px;height:32px;background:var(--bg-tertiary);border-radius:6px;margin:0 auto 0.4rem;"></div>
                            <div class="weight-name">${weight}</div>
                        </div>
                    `;
                });
            }
            
            weightHtml += '</div>';
            
            // Add import code
            weightHtml += `
                <div class="import-code">
                    <h3>Import</h3>
                    <code>import { ${icon.name} } from '@moamfar/icon-pack';</code>
                </div>
                <div class="import-code" style="margin-top: 1rem;">
                    <h3>Usage</h3>
                    <code>&lt;${icon.name} size={24} color="${state.iconColor}" /&gt;</code>
                </div>
            `;
            
            content.innerHTML = weightHtml;
            modal.classList.add('active');
        }

        function closeModal() {
            document.getElementById('weightModal').classList.remove('active');
        }

        // Close modal on outside click
        window.onclick = function(event) {
            const modal = document.getElementById('weightModal');
            if (event.target === modal) {
                closeModal();
            }
        }

        // Toggle sidebar on mobile
        const sidebarToggle = document.createElement('button');
        sidebarToggle.textContent = '‚ò∞ Categories';
        sidebarToggle.className = 'sidebar-toggle';
        sidebarToggle.style.cssText = `
            position: fixed;
            bottom: 20px;
            left: 20px;
            background: #4f46e5;
            color: white;
            border: none;
            border-radius: 30px;
            padding: 0.75rem 1.5rem;
            font-size: 1rem;
            font-weight: 500;
            cursor: pointer;
            box-shadow: 0 4px 12px rgba(79, 70, 229, 0.3);
            z-index: 50;
            display: none;
            transition: all 0.2s;
        `;
        
        sidebarToggle.onmouseenter = () => {
            sidebarToggle.style.transform = 'scale(1.05)';
        };
        
        sidebarToggle.onmouseleave = () => {
            sidebarToggle.style.transform = 'scale(1)';
        };
        
        sidebarToggle.onclick = () => {
            openSidebar();
        };
        
        document.body.appendChild(sidebarToggle);

        // Show toggle on mobile and ensure it's visible
        const mediaQuery = window.matchMedia('(max-width: 1024px)');
        const handleMobileChange = (e) => {
            if (e.matches) {
                sidebarToggle.style.display = 'block';
                sidebarToggle.style.opacity = '1';
                sidebarToggle.style.visibility = 'visible';
            } else {
                sidebarToggle.style.display = 'none';
                closeSidebar();
            }
        };
        
        mediaQuery.addListener(handleMobileChange);
        handleMobileChange(mediaQuery);

        // Load preferences and initialize
        loadPreferences();
        updateStats();
        renderWeightTabs();
        renderSidebar();
        filterIcons();
    </script>
</body>
</html>
